/**
 * Title: home.component.ts
 * Author: Professor Krasso
 * Date: 8/5/23
 */

// imports statements
import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<div class="container-fluid">
  <div class="row">
    <div class="col">
      <h1>Home Component Works! <span class="material-icons">thumb_up</span></h1>
    </div>
  </div>

  <a routerLink="/security">Test Security Module</a>
</div>
